import React from "react";

export const FooterLinks = (props) => {
  return (
    <footer class="footer">
      <div class="footerBox">
        <div class="row">
          <div class="footer-col">
            <h4>{props.title}</h4>
            <ul>
              <li>
                <a href="#">{props.content}</a>
              </li>
            </ul>
          </div>
        </div>
      </div>
    </footer >
  );
};

export default FooterLinks;
